import React from 'react';
import { colors } from '../assets/styles/colors';

const AppHeader = ({ stats, viewMode, setViewMode }) => {
  return (
    <header style={{
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      padding: '16px',
      backgroundColor: colors.primary,
      borderBottom: `1px solid ${colors.border}`
    }}>
      <div style={{ 
        height: '40px',
        width: '200px',
        display: 'flex',
        alignItems: 'center'
      }}>
        {/* Logo will go here */}
        <img 
          src="/logo.png" 
          alt="CenTap Logo" 
          style={{
            height: '100%',
            objectFit: 'contain'
          }}
        />
      </div>
      <div style={{ display: 'flex', alignItems: 'center' }}>
        <div style={{ marginRight: '16px' }}>
          <strong>{stats.present}</strong>/{stats.total} Present ({stats.rate}%)
        </div>
        <div style={{
          display: 'flex',
          backgroundColor: colors.hover,
          borderRadius: '4px',
          overflow: 'hidden'
        }}>
          <button 
            onClick={() => setViewMode('list')}
            style={{
              padding: '8px 12px',
              border: 'none',
              backgroundColor: viewMode === 'list' ? colors.secondary : 'transparent',
              color: viewMode === 'list' ? 'white' : colors.textPrimary,
              cursor: 'pointer'
            }}
          >
            List View
          </button>
          <button 
            onClick={() => setViewMode('grid')}
            style={{
              padding: '8px 12px',
              border: 'none',
              backgroundColor: viewMode === 'grid' ? colors.secondary : 'transparent',
              color: viewMode === 'grid' ? 'white' : colors.textPrimary,
              cursor: 'pointer'
            }}
          >
            Total View
          </button>
        </div>
      </div>
    </header>
  );
};

export default AppHeader;
